"original": |2-
     The header contains a list of property values that are applicable to
     the currently setup media or aggregate of media as indicated by the
     RTSP URI in the request.  No ordering is enforced within the header.
     Property values should be placed into a single group that handles a
     particular orthogonal property.  Values or groups that express
     multiple properties SHOULD NOT be used.  The list of properties that
     can be expressed MAY be extended at any time.  Unknown property
     values MUST be ignored.
"fixed": |-
  The header contains a list of property values that are applicable to the currently setup media or aggregate of media as indicated by the RTSP URI in the request.  No ordering is enforced within the header. Property values should be placed into a single group that handles a particular orthogonal property.  Values or groups that express multiple properties SHOULD NOT be used.  The list of properties that can be expressed MAY be extended at any time.  Unknown property values MUST be ignored.
"ko": |-
  헤더에는 요청의 RTSP URI에 표시된 대로 현재 설정된 미디어 또는 미디어 집합에 적용할 수 있는 속성 값 목록이 포함되어 있습니다. 헤더 내에서는 순서가 적용되지 않습니다. 속성 값은 특정 직교 속성을 처리하는 단일 그룹에 배치되어야 합니다. 여러 속성을 표현하는 값이나 그룹은 사용하면 안 됩니다. 표현될 수 있는 속성 목록은 언제든지 확장될 수 있습니다. 알 수 없는 속성 값은 무시되어야 합니다.
